import './App.css';
import Navbar from './Components/Navbar';
import TextForm from './Components/TextForm';

function App() {
  return (
    <>
    <Navbar title="Textutils" abouttext="About"/>
    <div className="container" my-3>
      <TextForm heading="Enter the text to analyze" />
    </div>
    </>
  );
}
export default App;
